'''Arnold Lydspor''' runs the [[Piscatoris Fishing Colony]] [[Arnold's Eclectic Supplies.|general store]] and bank, and is somewhat involved with [[Swan Song]]. The store and the bank are only available after finishing [[Swan Song]]. According to [[George Laxmeister]], Arnold's past is a rather mysterious one. He is suspected to be from a [[barbarian]] tribe, but he never speaks of it.

His store, [[Arnold's Eclectic Supplies]], provides rather unusual supplies for a [[general store]]. If you sell to Arnold, he will pay about 92% of [[high alchemy]] prices.

==Treasure Trails==
{{Cipher|Arnold Lydspor|hard|BSOPME MZETQPS}}. He will challenge the player to solve a [[puzzle box]]. You must have completed [[Swan Song]] to prompt the dialogue.

